import styled from 'styled-components';

export const Landingsection = styled.div`
 marign:0;
 padding:0;
 height:700px;
 width:100%;
 background:#162082;
 position:relative;
`;
export const Imagewrapper = styled.div`


`;
export const Image = styled.img`
position:absolute;
height:800px;
width:700px;
top:-50px;
left:0;
`;
export const Image1 = styled.img`
position:absolute;
height:100px;
width:100px;
top:0;
`;
export const Image2 = styled.img`
position:absolute;
height:130px;
width:130px;
bottom:0;
right:0;
`;
